import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import ForwardSharpIcon from '@material-ui/icons/ForwardSharp';

const KeepNote = () => {
  return (
    <>
      <div className = "container w-50 mx-auto py-5">
      <div className = "row">
      <div className = "col-md-10 col-12">
        <input type = "text" placeholder = "Title" className = "form-control"/>
        <textarea placeholder = "Keep a Note.." className = "form-control mt-1" rows = "" column = ""/>
        <button className = "btn btn-outline-info mt-1">Save a Note <ArrowForwardSharpIcon/></button>
      </div>
      </div>
      </div>
    </>
  );
}

export default KeepNote;
